import React, { useContext } from 'react'
import "./Contact.css"
import { Data } from '../../context/Userdata'
export default function Contact() {
  const b = useContext(Data)
  const mainfunc = (e, i) => {
    e.stopPropagation();
    b.setinputdisplay(true);
    b.setpointer(i);
  }
  return (
    <div id='contact' onClick={(e) => { mainfunc(e, 7) }} style={{ backgroundColor: b.contactbackgroundcolor }}>
      <div>
        <h2 onClick={(e) => { mainfunc(e, 6) }} style={{ color: b.contactcolor }}>Contact</h2>
      </div>
      <div className='information'>
        <div style={{ borderLeftColor: b.contactcolor }}>
          <svg width="80px" height="80px" viewBox="0 0 1024.00 1024.00" class="icon" version="1.1" xmlns="http://www.w3.org/2000/svg" fill="#000000" stroke="#000000" stroke-width="0.01024"><g id="SVGRepo_bgCarrier" stroke-width="0"></g><g id="SVGRepo_tracerCarrier" stroke-linecap="round" stroke-linejoin="round"></g><g id="SVGRepo_iconCarrier"><path d="M522.24 81.984a308.288 308.288 0 0 0-308.352 308.352c0 224.96 308.352 461.632 308.352 461.632s85.056-65.6 165.888-160.256a22.4 22.4 0 0 0-15.744-38.4 22.016 22.016 0 0 0-17.152 8.512l-0.064-0.064 74.496-109.376 3.52 2.176a21.568 21.568 0 0 0-3.968 11.968 22.4 22.4 0 0 0 22.4 22.464 22.272 22.272 0 0 0 20.992-15.36c33.92-58.56 57.92-121.216 57.92-183.232A308.224 308.224 0 0 0 522.24 81.984z" fill=""></path><path d="M716.864 620.416m-22.4 0a22.4 22.4 0 1 0 44.8 0 22.4 22.4 0 1 0-44.8 0Z" fill=""></path><path d="M522.24 126.784a263.808 263.808 0 0 0-263.552 263.552c0 163.008 191.168 341.824 263.552 403.648 72.384-61.824 263.552-240.64 263.552-403.648A263.872 263.872 0 0 0 522.24 126.784z m0 432.576a172.032 172.032 0 1 1 0-344.064 172.032 172.032 0 0 1 0 344.064z" fill={b.contactcolor}></path><path d="M522.24 387.328m-127.168 0a127.168 127.168 0 1 0 254.336 0 127.168 127.168 0 1 0-254.336 0Z" fill="#FFFFFF"></path><path d="M186.304 936.384m-22.4 0a22.4 22.4 0 1 0 44.8 0 22.4 22.4 0 1 0-44.8 0Z" fill=""></path><path d="M263.04 913.984a22.464 22.464 0 0 0-22.4 22.4v0.064c0 12.288 10.112 22.4 22.4 22.4h595.2c12.288 0 22.4-10.048 22.4-22.4v-0.064a22.464 22.464 0 0 0-22.4-22.4h-595.2z" fill=""></path><path d="M292.8 359.36a16 16 0 0 1-15.744-18.816c25.6-144 153.28-183.616 158.656-185.216a16 16 0 0 1 9.152 30.656c-4.672 1.408-114.24 35.968-136.384 160.192a16 16 0 0 1-15.68 13.184z" fill="#FFFFFF"></path></g></svg>
          <div>
            <h3 style={{ color: b.contactcolor }} onClick={(e) => { mainfunc(e, 6) }}>Location</h3>
            <p contentEditable="true" suppressContentEditableWarning={true}>Ambala</p>
          </div>
        </div>
        <div style={{ borderLeftColor: b.contactcolor }}>
        <svg viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg"><g id="SVGRepo_bgCarrier" stroke-width="0"></g><g id="SVGRepo_tracerCarrier" stroke-linecap="round" stroke-linejoin="round"></g><g id="SVGRepo_iconCarrier"> <path fill-rule="evenodd" clip-rule="evenodd" d="M3.75 5.25L3 6V18L3.75 18.75H20.25L21 18V6L20.25 5.25H3.75ZM4.5 7.6955V17.25H19.5V7.69525L11.9999 14.5136L4.5 7.6955ZM18.3099 6.75H5.68986L11.9999 12.4864L18.3099 6.75Z" fill="#080341"></path> </g></svg>          <div>
            <h3 style={{ color: b.contactcolor }} onClick={(e) => { mainfunc(e, 6) }}>Email</h3>
            <p contentEditable="true" suppressContentEditableWarning={true}>xyz@gmail.com</p>
          </div>
        </div>
      </div>
    </div>
  )
}
